--
-- Table structure for table `firstnames`
--

CREATE TABLE `firstnames` (
    `Name` varchar(64) NOT NULL,
    `Name ASCII` varchar(64) NOT NULL,
    `Country code` varchar(64) NOT NULL,
    `Country name` varchar(64) NOT NULL,
    `Continent` varchar(64) NOT NULL,
    `Official` varchar(64) NOT NULL,
    `Gender` varchar(64) NOT NULL,
    `Unisex` varchar(64) NOT NULL,
    `Country Rank` varchar(64) NOT NULL,
    `Frequency` varchar(64) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

